import React from 'react';

class GridImage extends React.Component {
    render() {
        return <div className="m-5 bg-black">
                    <div className="color-neogreen p-10 m-auto w-200 mb-5">{this.props.item.location}</div>
                    <img src={this.props.item.image}/>
                    <div className="white m-auto pt-5 pb-5 w-200 mb-5 description">{this.props.item.description}</div>
                </div>
    }

}
export default GridImage
